package benedictoxvi.pe.data;

public class Prospecto {
	int NumProspecto;
	String FecProspecto;
	String NomProspecto;
	String ApePaterno;
	String ApeMaterno;
	String Nombes;
	String Correo;
	String NroDNI;
	String Telefono;
	String Celular;
	String Estado; 
	// ' ' = Solo Prospecto, 'C' = Convertido a Cliente(Dado de Alta)
	// 'X' = Dado e baja 
	
	public Prospecto() {
		// TODO Auto-generated constructor stub
	}
	
	public int getNumProspecto() {
		return NumProspecto;
	}
	public void setNumProspecto(int numProspecto) {
		NumProspecto = numProspecto;
	}
	public String getFecProspecto() {
		return FecProspecto;
	}
	public void setFecProspecto(String fecProspecto) {
		FecProspecto = fecProspecto;
	}
	public String getNomProspecto() {
		return NomProspecto;
	}
	public void setNomProspecto(String nomProspecto) {
		NomProspecto = nomProspecto;
	}
	public String getApePaterno() {
		return ApePaterno;
	}
	public void setApePaterno(String apePaterno) {
		ApePaterno = apePaterno;
	}
	public String getApeMaterno() {
		return ApeMaterno;
	}
	public void setApeMaterno(String apeMaterno) {
		ApeMaterno = apeMaterno;
	}
	public String getNombes() {
		return Nombes;
	}
	public void setNombes(String nombes) {
		Nombes = nombes;
	}
	public String getCorreo() {
		return Correo;
	}
	public void setCorreo(String correo) {
		Correo = correo;
	}
	public String getNroDNI() {
		return NroDNI;
	}
	public void setNroDNI(String nroDNI) {
		NroDNI = nroDNI;
	}
	public String getTelefono() {
		return Telefono;
	}
	public void setTelefono(String telefono) {
		Telefono = telefono;
	}
	public String getCelular() {
		return Celular;
	}
	public void setCelular(String celular) {
		Celular = celular;
	}
	public String getEstado() {
		return Estado;
	}
	public void setEstado(String estado) {
		Estado = estado;
	}
	
	
}
